const express = require('express');
const router = express.Router();
const { google } = require('googleapis');
const googleConfig = require.main.require('./app/config/google');
const googleContacts = google.people('v1');

const { isAuthenticated } = require('../middleware');

const User = require.main.require('./app/models/user');
const Recipient = require.main.require('./app/models/recipient');

router.get('/', isAuthenticated, (req, res) => {

	const oauth2Client = googleConfig.newOauth2Client({
		accessToken: User.decryptAccessToken(req.user.google.accessToken),
		refreshToken: req.user.google.refreshToken
	});
    const animalType = req.query.animal_type;

    googleContacts.people.connections.list({
        auth: oauth2Client,
        resourceName: 'people/me',
        pageSize: 500,
        'requestMask.includeField': ['person.phoneNumbers', 'person.names'],
        sortOrder: 'LAST_MODIFIED_ASCENDING'
    }, (err, data) => {
        if (err) return res.status(err.code || 400).json(err);

        /*
         * Reduce Google Contacts result to simple array of {name: '', number: ''}'s
         * First filter out objects without any phone numbers,
         * then rip phone numbers out of their contact's object and make new objects for each one
         */
        if (data.connections) {
            let contacts = data.connections
            	.filter(o => o.phoneNumbers && o.phoneNumbers.length > 0)
            	.map((o, i) => {
    	        	if (!o.phoneNumbers) return o;
    	        	var contacts = [];
    	        	for (var i = 0; i < o.phoneNumbers.length; i++) {
    		            contacts.push({
    		                name: o.names ? (o.names[0].givenName + (o.names[0].familyName ? (' ' + o.names[0].familyName) : '')) : undefined,
    		                number: o.phoneNumbers[i].value.replace(/\D/g,'').replace(/^1+/, '')
    	            	});
    	        	}
    	        	return contacts;
    	        });

            // Flatten array and reverse sort order
            contacts = [].concat.apply([], contacts).reverse();

            Recipient.find({number: {$in: contacts.map(o => o.number)}}).then(function(recipients) {
                contacts = contacts.map(contact => {
                    contact.added = !!recipients.find(recipient => {
                        return recipient.number == contact.number && recipient.subscriptions.includes(animalType);
                    });
                    return contact;
                });

                return res.status(200).json(contacts); 
            });
        } else {
            return res.status(204).json([]);
        }
    });
});

module.exports = router;

const express = require('express');
const router = express.Router();

const strings = require.main.require('./app/config/strings.js');
const { isAuthenticated, logApiRequest } = require('../middleware');

const Fact = require.main.require('./app/models/fact');
const User = require.main.require('./app/models/user');

router.get('/', async(req, res) => {
    try {
        const facts = await Fact.find().limit(5);
        return res.status(200).json(facts);
    } catch (err) {
        return res.status(err.status || 400).json(err);
    }
})

// Get submitted facts
router.get('/me', async(req, res) => {

    const animalType = req.query.animal_type ? req.query.animal_type.split(',') : ['cat'];

    try {
        const data = await Fact.find({
                user: req.user._id,
                type: { $in: animalType }
            })
            .select('text type')
            .populate('user', 'name')
            .limit(10)

        return res.status(200).json(data);
    } catch (err) {
        return res.status(400).json(err);
    }
});

// Get a random fact
router.get('/random', logApiRequest, async(req, res) => {

    const animalType = req.query.animal_type ? req.query.animal_type.split(',') : ['cat'];
    const amount = req.query.amount;

    if (amount > 500) {
        return res.status(405).json({ message: 'Limited to 500 facts at a time' });
    }

    try {
        const facts = await Fact.getFact({ amount, animalType });
        return res.status(200).json(facts);
    } catch (err) {
        return res.status(err.status).json(err);
    }
});

// Get fact by ID
router.get('/:factID', logApiRequest, async(req, res) => {
    try {
        const fact = await Fact.findById(req.params.factID).populate('user', 'name photo');

        if (!fact) {
            return res.status(404).json({ message: 'Fact not found' });
        }

        return res.status(200).json(fact);
    } catch (err) {
        return res.status(400).json(err);
    }
});

// Submit a fact
router.post('/', isAuthenticated, async(req, res) => {

    if (!req.body.factText) {
        return res.status(400).json({ message: "Missing body paramter: factText" });
    }
    if (!req.body.animalType) {
        return res.status(400).json({ message: "Missing body parameter: animalType" });
    }

    const io = req.app.get('socketio');

    let text = req.body.factText;

    text = text.charAt(0).toUpperCase() + text.slice(1); // Capitalize
    text += text[text.length - 1] == "." ? "" : "."; // Add period to end

    const fact = new Fact({
        user: req.user._id,
        text,
        type: req.body.animalType
    });

    try {
        const savedFact = await fact.save();

        const populatedFact = await User.populate(savedFact, { path: 'user', select: 'name' });

        io.emit('fact', populatedFact);

        return res.status(200).json(populatedFact);
    } catch (err) {
        if (err.code === 11000) {
            err.message = strings.fact.exists;
            return res.status(409).json(err);
        }
        return res.status(400).json(err);
    }
});

module.exports = router;

